import pandas as pd
import re
import sqlite3
from datetime import datetime
from typing import Dict, List, Optional, Tuple
import hashlib
import json

class DataLoader:
    def load_fpds_data(self, file_path: str) -> pd.DataFrame:
        try:
            data = pd.read_csv(file_path)
            return data
        except Exception as e:
            print(f"Error loading FPDS data: {e}")
            return pd.DataFrame()

    def load_fabs_data(self, file_path: str) -> pd.DataFrame:
        try:
            data = pd.read_csv(file_path)
            return data
        except Exception as e:
            print(f"Error loading FABS data: {e}")
            return pd.DataFrame()

class Validator:
    def validate_duns(self, duns: str) -> bool:
        if not duns or len(duns) != 9 or not duns.isdigit():
            return False
        return True

    def validate_zip(self, zip_code: str) -> bool:
        if not zip_code:
            return False
        us_zip_pattern = r'^\d{5}(?:-\d{4})?$'
        return re.match(us_zip_pattern, zip_code) is not None

class AgencyCoder:
    def derive_funding_agency_code(self, agency_name: str) -> Optional[str]:
        agency_codes = {
            "Department of Defense": "DOD",
            "Department of Education": "ED",
            "Department of Health and Human Services": "HHS"
        }
        return agency_codes.get(agency_name)

class SubmissionManager:
    def __init__(self):
        self.conn = sqlite3.connect(':memory:')
        self._create_submission_table()

    def _create_submission_table(self):
        query = """
        CREATE TABLE IF NOT EXISTS submissions (
            id INTEGER PRIMARY KEY,
            status TEXT,
            created_at TEXT,
            updated_at TEXT
        )
        """
        self.conn.execute(query)
        self.conn.commit()

    def track_submission_status(self, submission_id: int) -> Optional[Dict]:
        query = "SELECT * FROM submissions WHERE id = ?"
        result = self.conn.execute(query, (submission_id,)).fetchone()
        if result:
            return {"id": result[0], "status": result[1], "created_at": result[2], "updated_at": result[3]}
        return None

    def update_submission_status(self, submission_id: int, status: str) -> bool:
        query = "UPDATE submissions SET status = ?, updated_at = ? WHERE id = ?"
        try:
            self.conn.execute(query, (status, datetime.now(), submission_id))
            self.conn.commit()
            return True
        except Exception as e:
            print(f"Error updating submission status: {e}")
            return False

    def process_deletion(self, submission_id: int) -> bool:
        query = "DELETE FROM submissions WHERE id = ?"
        try:
            self.conn.execute(query, (submission_id,))
            self.conn.commit()
            return True
        except Exception as e:
            print(f"Error deleting submission: {e}")
            return False

class DFileGenerator:
    def __init__(self):
        self.cache = {}

    def _generate_cache_key(self, data: List) -> str:
        data_str = json.dumps(data, sort_keys=True)
        return hashlib.md5(data_str.encode()).hexdigest()

    def sync_d1_with_fpds(self, fpds_data: pd.DataFrame) -> pd.DataFrame:
        d1_data = fpds_data.copy()
        d1_data['synced_at'] = datetime.now()
        return d1_data

    def generate_d_file(self, data: List, use_cache: bool = True) -> Dict:
        cache_key = self._generate_cache_key(data)
        if use_cache and cache_key in self.cache:
            return self.cache[cache_key]

        processed_data = {"data": data, "generated_at": datetime.now()}
        if use_cache:
            self.cache[cache_key] = processed_data
        return processed_data

class ErrorCodeManager:
    def update_error_code(self, old_code: str, new_code: str, description: str) -> Dict:
        return {"old_code": old_code, "new_code": new_code, "description": description}

class UIManager:
    def __init__(self):
        self.ui_issues = []

    def track_ui_issue(self, issue: str, page: str) -> None:
        self.ui_issues.append({"issue": issue, "page": page, "reported_at": datetime.now()})

    def get_ui_issues(self) -> List[Dict]:
        return self.ui_issues

class TestingManager:
    def __init__(self):
        self.test_sessions = []
        self.test_results = []

    def schedule_user_testing(self, date: str, participants: List[str]) -> Dict:
        session = {"date": date, "participants": participants, "scheduled_at": datetime.now()}
        self.test_sessions.append(session)
        return session

    def generate_test_summary(self, session_id: int, feedback: List[str], issues: List[str]) -> Dict:
        summary = {
            "session_id": session_id,
            "feedback": feedback,
            "issues": issues,
            "generated_at": datetime.now()
        }
        self.test_results.append(summary)
        return summary

class DeveloperTools:
    def derive_office_name(self, office_code: str) -> Optional[str]:
        office_names = {
            "OC1": "Office of Contracts",
            "OC2": "Office of Grants",
            "OC3": "Office of Compliance"
        }
        return office_names.get(office_code)

    def get_submission_dashboard(self) -> List[Dict]:
        query = "SELECT * FROM submissions ORDER BY updated_at DESC"
        results = sqlite3.connect(':memory:').execute(query).fetchall()
        return [{"id": r[0], "status": r[1], "created_at": r[2], "updated_at": r[3]} for r in results]

class SQLCodeManager:
